import React, { useState } from 'react';
import './index.css';
const TodoList=()=>{


    const [num,setNum]=useState(0);

    const inceNum=()=>{
        setNum(num+1)
    }


return(
    <>
    <div className='main_div'>
        <div className="center_div">
        <h1> {num} </h1>
        <div className="btn_div">
            <button onClick={inceNum}>Increment</button>
            <button onClick={decceNum}>Decrement</button>
        </div>
        </div>
    </div>
    </>
)
}
export default TodoList
